import React from "react";
import SmallPicture from "./Images/petsrunning.jpg";

function AboutDevs() {
  return (
    <div className="halfDivCard row">
      <div className="maxHeightHalf pb-2 col-12 col-md-4">
        <img className="petImgHeightHalf" src={SmallPicture}></img>
      </div>
      <div className="maxHeightHalf contentCenter pb-2 col-12 col-md-8 order-md-1">
        <span className="abouSession">
          <h4>Devs</h4>
          <h5>We are a social network for pet lovers.</h5>
          <h5>
            Create a page, share the best pictures of your pets and follow
            friends with commom interests.
          </h5>
          <h5>
            Here you can find a lot of content about pets and even addopt a pet.
          </h5>
        </span>
      </div>
    </div>
  );
}

export default AboutDevs;
